gram\/post\/2915255986803156016.jpg?w=200&till=1673253128&sign=97e68abc86c277d68471541e4e55706e\";s:11:\"time_posted\";i:1661745616;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2915255986803156016.jpg?w=200&till=1673253128&sign=97e68abc86c277d68471541e4e55706e\";s:3:\"day\";s:2:\"29\";s:5:\"month\";s:2:\"08\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:8065162;s:14:\"comments_count\";i:0;s:17:\"video_views_count\";i:0;s:2:\"er\";d:3.45;s:7:\"er_mark\";s:4:\"high\";}}i:1;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":11:{s:2:\"id\";s:19:\"2961894145347154677\";s:4:\"code\";s:11:\"CkawwhLufL1\";s:7:\"caption\";s:571:\"I’m enchanted to announce my next tour: Taylor Swift | The Eras Tour, a journey through the musical eras of my career (past and present!) The first leg of the tour will be in stadiums across the US, with international dates to be announced as soon as we can! Feeling like the luckiest person alive because I get to take these brilliant artists out on tour with me: @paramore, @radvxz, @phoebebridgers, @girlinred, @whereismuna, @haimtheband, @gracieabrams, @gayle and @owennmusic. I can’t WAIT to see your gorgeous faces out there. It’s been a long time coming 🥰\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2961894145347154677.jpg?w=200&till=1673253128&sign=4f5971b48f5d8559915f3c8d090c3ff9\";s:11:\"time_posted\";i:1667305318;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2961894145347154677.jpg?w=200&till=1673253128&sign=4f5971b48f5d8559915f3c8d090c3ff9\";s:3:\"day\";s:2:\"01\";s:5:\"month\";s:2:\"11\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:5600398;s:14:\"comments_count\";i:0;s:17:\"video_views_count\";i:0;s:2:\"er\";d:2.39;s:7:\"er_mark\";s:4:\"good\";}}i:2;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":11:{s:2:\"id\";s:19:\"2953760335023622199\";s:4:\"code\";s:11:\"Cj93WAAuMg3\";s:7:\"caption\";s:441:\"Surprise! I think of Midnights as a complete concept album, with those 13 songs forming a full picture of the intensities of that mystifying, mad hour. However! There were other songs we wrote on our journey to find that magic 13. I’m calling them 3am tracks. Lately I’ve been loving the feeling of sharing more of our creative process with you, like we do with From The Vault tracks. So it’s 3am and I’m giving them to you now. 🌌\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2953760335023622199.jpg?w=200&till=1673253128&sign=297200dafb13f253302b233c5b07385f\";s:11:\"time_posted\";i:1666335692;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2953760335023622199.jpg?w=200&till=1673253128&sign=297200dafb13f253302b233c5b07385f\";s:3:\"day\";s:2:\"21\";s:5:\"month\";s:2:\"10\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:4844326;s:14:\"comments_count\";i:0;s:17:\"video_views_count\";i:0;s:2:\"er\";d:2.07;s:7:\"er_mark\";s:4:\"good\";}}i:3;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":11:{s:2:\"id\";s:19:\"2953669479344288504\";s:4:\"code\";s:11:\"Cj9ir4EOrL4\";s:7:\"caption\";s:1144:\"Midnights is a wild ride of an album and I couldn’t be happier that my co pilot on this adventure was @jackantonoff. He’s my friend for life (presumptuous I know but I stand by it) and we’ve been making music together for nearly a decade HOWEVER… this is our first album we’ve done with just the two of us as main collaborators. We’d been toying with ideas and had written a few things we loved, but Midnights actually really coalesced and flowed out of us when our partners (both actors) did a film together in Panama. Jack and I found ourselves back in New York, alone, recording every night, staying up late and exploring old memories and midnights past. We were so lucky to also work with our brilliant collaborators @sam_dew, @sounwave, Lana Del Rey, @jahaansweet, @keanubeats, William Bowery, and @zoeisabellakravitz. @sharp_stick was our excellent engineer. The wonderful and wise @bethgarrabrant took the album photographs. Midnights is a collage of intensity, highs and lows and ebbs and flows. Life can be dark, starry, cloudy, terrifying, electrifying, hot, cold, romantic or lonely. Just like Midnights. Which is out now\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2953669479344288504.jpg?w=200&till=1673253128&sign=60a7db04dd977cafe977c60abab4d02b\";s:11:\"time_posted\";i:1666324861;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2953669479344288504.jpg?w=200&till=1673253128&sign=60a7db04dd977cafe977c60abab4d02b\";s:3:\"day\";s:2:\"21\";s:5:\"month\";s:2:\"10\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:4470824;s:14:\"comments_count\";i:0;s:17:\"video_views_count\";i:0;s:2:\"er\";d:1.91;s:7:\"er_mark\";s:4:\"good\";}}i:4;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":11:{s:2:\"id\";s:19:\"2956333196569703401\";s:4:\"code\";s:11:\"CkHAWEDO3Pp\";s:7:\"caption\";s:400:\"Midnight, what a storied and fabled hour… On this sparkling evening I’ll be releasing my twist on a fairytale we all know. The one about the girl and her step sisters and the clock striking 12… This video is wild, whimsical and created SPECIFICALLY for you, my beloved fans who have paved this shimmering path. Look out for some dazzling cameos! Join us later for a very Bejeweled premiere 💎\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2956333196569703401.jpg?w=200&till=1673253128&sign=46d7e0d5a178498c8de0d2d2667cdff9\";s:11:\"time_posted\";i:1666642401;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2956333196569703401.jpg?w=200&till=1673253128&sign=46d7e0d5a178498c8de0d2d2667cdff9\";s:3:\"day\";s:2:\"24\";s:5:\"month\";s:2:\"10\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:4260663;s:14:\"comments_count\";i:0;s:17:\"video_views_count\";i:0;s:2:\"er\";d:1.82;s:7:\"er_mark\";s:4:\"good\";}}i:5;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":11:{s:2:\"id\";s:19:\"2956572374297472424\";s:4:\"code\";s:11:\"CkH2ujqu-2o\";s:7:\"caption\";s:332:\"Bejeweled video is out NOW! Directed by this tired tacky wench. Got to make this with my best friends @haimtheband, greatest of greats @lauradern, icon of burlesque and glamour @ditavonteese, genius and actual dame @patmcgrathreal and my partner in Midnights mayhem @jackantonoff. Love you guys so much. Stay sparkly out there. 😘\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2956572374297472424.jpg?w=200&till=1673253128&sign=4b210637b218e55fc40866a8789f7091\";s:11:\"time_posted\";i:1666670913;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2956572374297472424.jpg?w=200&till=1673253128&sign=4b210637b218e55fc40866a8789f7091\";s:3:\"day\";s:2:\"25\";s:5:\"month\";s:2:\"10\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:3688661;s:14:\"comments_count\";i:0;s:17:\"video_views_count\";i:0;s:2:\"er\";d:1.58;s:7:\"er_mark\";s:4:\"good\";}}}}s:14:\"similar_report\";a:0:{}s:14:\"hashtag_report\";a:0:{}s:19:\"frequently_hashtags\";a:0:{}s:17:\"favorite_mentions\";a:5:{i:0;a:2:{s:5:\"title\";s:12:\"jackantonoff\";s:5:\"value\";d:1.78;}i:1;a:2:{s:5:\"title\";s:10:\"primevideo\";s:5:\"value\";d:1.24;}i:2;a:2:{s:5:\"title\";s:5:\"gayle\";s:5:\"value\";d:2.45;}i:3;a:2:{s:5:\"title\";s:12:\"nsaiofficial\";s:5:\"value\";d:1.26;}i:4;a:2:{s:5:\"title\";s:11:\"amazon